import React from 'react';
import CO2Summary from './components/co2explain';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid
} from 'recharts';

function PredictionChart({ data }) {
  return (
    <div className="mt-8">
      <h2 className="text-xl font-semibold mb-2">Emission Predictions (2025â€“2050)</h2>
      <LineChart width={800} height={400} data={data}>
        <XAxis dataKey="year" />
        <YAxis />
        <Tooltip />
        <CartesianGrid strokeDasharray="3 3" />
        <Line type="monotone" dataKey="predicted_co2" stroke="#82ca9d" />
      </LineChart>
      <Chart data={data} />
    <CO2Summary data={data.concat(predicted)} />
    <PredictionChart data={predicted} />
    </div>
  );
}

export default PredictionChart;
